import { Container, Badge } from "react-bootstrap";

const Solution = () => {
  return (
    <Container>
      <h2>Solutions</h2>
      1. Always ensure that 1Password 8 is placed in the main Applications
      folder. If you are not sure, Open <i><code>Terminal</code></i> and run this command line in.
      <code>
        /System/Library/Frameworks/CoreServices.framework/Frameworks/LaunchServices.framework/Support/lsregister
        -dump| grep '.*path.*1Password Browser Helper'
      </code>
      2. It should provide the path of the 1Password Helper in /Application folder like this.
      <code>path:    /Applications/1Password.app/Contents/Library/LoginItems/1Password Browser Helper.app (0x940)</code>
      3. If the path of <code>1Password Browser Helper.app</code> is not in <code>Applications</code> folder, run this line in <code>Terminial</code> to rebuild the Launch Services database:
      <code>/System/Library/Frameworks/CoreServices.framework/Frameworks/LaunchServices.framework/Support/lsregister -kill -r -domain local -domain system -domain user</code>
    </Container>
  );
};

export default Solution;
